function minimumBribes(q: number[]): void {
    let bribes = 0

    // if expected is different than actual, change expected based on the bribes made
    let expected1 = 1;
    let expected2 = 2;
    let expected3 = 3;

    for (let index = 0; index < q.length; index++) {
        const initialInd = q[index] - 1;
        const finalInd = index;
        // 1. Has this person moved more than two positions forward ?
        const spotsMovedForward = initialInd - finalInd
        if (spotsMovedForward > 2) {
            console.log("Too chaotic");
            return
        }
        // 2. How many times has this person been bribed ?
        // on next loop, increment expecteds
        if (expected1 === q[index]) {
            // expected person in correct place, no bribes performed here
            expected1 = expected2
            expected2 = expected3
        } else if (expected2 === q[index]) {
            // if expected2 is in current place instead of expected1, add a bribe
            bribes++
            // expected1 will not be incremented next time as they were bribed
            // increment expected2 for next loop
            expected2 = expected3
        } else if (expected3 === q[index]) {
            // if expected3 is in current place instead of expected1, add 2 bribes
            bribes += 2;
            // expected1 will not be incremented next time as they were bribed
            // expected2 will not be incremented next time as they were bribed
        }
        expected3++
        // ! avoid nested loop
        // ! 2nd try
        // for (let i = finalInd; i < q.length; i++) {
        //     const briberInitialInd = q[i] - 1;
        //     if (initialInd > briberInitialInd) {
        //         bribes++
        //     }
        // }
    }
    console.log(bribes)
}

